import { UserContext } from "../contexts/UserContext"
const Produit = () => {
  return (
    <>
      <UserContext.Consumer>
        {(user)=>{
          return(
            <p>{user}</p>
          )
        }}
      </UserContext.Consumer>
    </>
  )
}

export default Produit
